'''
You are given the root of a binary tree with n nodes. Each node is uniquely assigned a value from 1 to n. You are also given an integer startValue representing the value of the start node s, and a different integer destValue representing the value of the destination node t.

Find the shortest path starting from node s and ending at node t. Generate step-by-step directions of such path as a string consisting of only the uppercase letters 'L', 'R', and 'U'. Each letter indicates a specific direction:

    'L' means to go from a node to its left child node.
    'R' means to go from a node to its right child node.
    'U' means to go from a node to its parent node.
    Return the step-by-step directions of the shortest path from node s to node t.
'''

from typing import List, Set, Tuple, Optional

# Definition for a binary tree node.
class TreeNode:
    def __init__(self, val=0, left=None, right=None):
        self.val = val
        self.left = left
        self.right = right

class Solution:
    def buildTree(self, nodeValues: List[Optional[int]]) -> Optional[TreeNode]:
        root = None
        nodes = []

        while (root == None or len(nodes)) and len(nodeValues):
            leftSet  = False
            while len(nodeValues):
                #print('nodes = {}'.format(nodes))
                v = nodeValues.pop(0)

                if v:
                    n = TreeNode(val=v)
                else:
                    n = None

                if root == None:
                    if n != None:
                        root = n
                        nodes.append(n)
                        break
                    else:
                        return root

                if n:
                    nodes.append(n)
                if leftSet:
                    parent.right = n
                    break
                else:
                    parent = nodes.pop(0)
                    parent.left  = n
                    leftSet      = True

        return root

    def getDirections(self, root: Optional[TreeNode], startValue: int, destValue: int) -> str:
        nodes = [root]
        root.path = ''
        startPath = None
        destPath  = None
        while len(nodes):
            n = nodes.pop(0)
            #print('n = {}'.format(n.val))
            if n.val == startValue:
                startPath = n.path
                if destPath:
                    break
            if n.val == destValue:
                destPath = n.path
                if startPath:
                    break
            if n.left:
                n.left.path = n.path + 'L'
                nodes.append(n.left)
            if n.right:
                n.right.path = n.path + 'R'
                nodes.append(n.right)
            n.path = None
        
        #print('startNode = {}, destNode = {}'.format(startNode.path, destNode.path))
        
        prefixLen = 0
        for i in range(min(len(startPath), len(destPath))):
            if startPath[i] == destPath [i]:
                prefixLen += 1
            else:
                break
        
        #print('prefixLen = {}'.format(prefixLen))
        if prefixLen == len(startPath):
            prefix = ''
        else:
            prefix = 'U' * (len(startPath) - prefixLen)
                            
        return prefix + destPath[prefixLen:]
 

